local textures = {
    deepslate_runed_earth = "",
    deepslate_runed_fire = "",
    deepslate_runed_ice = "",
    deepslate_runed_lightning = "",
    deepslate_runed_poison = "",
    deepslate_runed_telepathic = "",
    deepslate_runed_void = "",
    deepslate_runed_water = "",
    deepslate_runed_wind = "",
    ancient_torch = "",
    ancient_lantern = "",
    --[[ancient_lantern_inv = "",]]
    ancient_light = "",
    magikacia_leaves_jungle = "",
    leaves_maple = "",
}
for k, v in pairs(textures) do
    textures[k] = "blank.png^[png:" .. textures[k]
    minetest.register_craftitem(":magikacia:zzz_textures_" .. k, {
        description = k,
        inventory_image = textures[k],
        groups = { dig_immediate = 3, not_in_creative_inventory = 1, },
    })
end
table.update(magikacia.textures, textures)